import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { fetchPhotos } from "../store/photos";

const Photos = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchPhotos(1));
  }, [dispatch]);
  return <h1>Photos</h1>;
};

export default Photos;
